  input: TEXT,SA11A1,SA11A1.73279,"On 7/27/07 we received a contribution from V. Richard
    Miller in the amount of $25,000 which was deposited into our federal account.  Fifteen
    thousand dollars was transferred to our non-federal account, which can accept
    unlimited contributions from individuals, on 7/27/07.  A letter was sent to Mr.
    Miller explaining to him how his contribution was split into our accounts and
    to offer him a chance for a refund.  According to AO 2001-17, the Commission has
    deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
    for the portion that is over the federal limit.  Therefore year to date aggregate
    totals reported by V. Richard Miller on our report is a  reflection of the federal
    portion of the donor's contributions to date."
